import Slide from './Slide'

import { Box } from "@mui/material";



const AdsSlide = ({ products, title,timer }) => {
    return (
        <Box>
            <Box>
                <Slide 
                  products={products}
                  title={title}
                  timer={timer}
                />
            </Box>
            <Box>

            </Box>
        </Box>
    )
}
export default AdsSlide;
